import React, { useState } from "react";
import Position from "../components/position";
import "./4231style.css";
import axios from "axios";

function Formation4231() {

  const players = [
    "player0",
    "player1",
    "player2",
    "player3",
    "player4",
    "player5",
    "player6",
    "player7",
    "player8",
    "player9",
    "player10",
  ];

  const roles = [
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role"
  ]

  const roleToPositionMapping = {
    [players[0]]: roles[0],
    [players[1]]: roles[1],
    [players[2]]: roles[2],
    [players[3]]: roles[3],
    [players[4]]: roles[4],
    [players[5]]: roles[5],
    [players[6]]: roles[6],
    [players[7]]: roles[7],
    [players[8]]: roles[8],
    [players[9]]: roles[9],
    [players[10]]: roles[10]
  };

  const handleRoleChange = (player, newRole) => {
    // Update the role for the specified player
    roleToPositionMapping[player] = newRole;

    // Log the updated mapping
    console.log("Updated role mapping:", roleToPositionMapping);
  };


  const [bestTeam, setBestTeam] = useState(null);

  const handleGetBestTeam = () => {
    const selectedRoles = roleToPositionMapping;

    axios.post('/get_best_team', { selected_roles: selectedRoles })
      .then(response => {
        setBestTeam(response.data);
      })
      .catch(error => {
        console.error('Error fetching the best team:', error);
      });
  };


  return (
    <div className="formation4231">
      <div className="attackLane4231">
      <Position playerName={players[0]} positionName="ATTACK" onRoleChange={(role) => handleRoleChange(players[0], role)} selectedPlayer={bestTeam && `${bestTeam.player0.Nom} (${bestTeam.player0.Note})`}/>
      </div>
      <div className="midLaneFront4231">
      <Position playerName={players[1]} positionName="AIL" onRoleChange={(role) => handleRoleChange(players[1], role)} selectedPlayer={bestTeam && `${bestTeam.player1.Nom} (${bestTeam.player1.Note})`}/>
      <Position playerName={players[2]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[2], role)} selectedPlayer={bestTeam && `${bestTeam.player2.Nom} (${bestTeam.player2.Note})`}/>
        <Position playerName={players[3]} positionName="AIL" onRoleChange={(role) => handleRoleChange(players[3], role)} selectedPlayer={bestTeam && `${bestTeam.player3.Nom} (${bestTeam.player3.Note})`}/>
      </div>
      <div className="midLaneBack4231">
        <Position playerName={players[4]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[4], role)} selectedPlayer={bestTeam && `${bestTeam.player4.Nom} (${bestTeam.player4.Note})`}/>
        <Position playerName={players[5]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[5], role)} selectedPlayer={bestTeam && `${bestTeam.player5.Nom} (${bestTeam.player5.Note})`} />
      </div>
      <div className="backLane4231">
      <Position playerName={players[6]} positionName="LAT" onRoleChange={(role) => handleRoleChange(players[6], role)} selectedPlayer={bestTeam && `${bestTeam.player6.Nom} (${bestTeam.player6.Note})`}/>
        <Position playerName={players[7]} positionName="DEF" onRoleChange={(role) => handleRoleChange(players[7], role)} selectedPlayer={bestTeam && `${bestTeam.player7.Nom} (${bestTeam.player7.Note})`}/>
        <Position playerName={players[8]} positionName="DEF"onRoleChange={(role) => handleRoleChange(players[8], role)} selectedPlayer={bestTeam && `${bestTeam.player8.Nom} (${bestTeam.player8.Note})`}/>
        <Position playerName={players[9]} positionName="LAT"onRoleChange={(role) => handleRoleChange(players[9], role)} selectedPlayer={bestTeam && `${bestTeam.player9.Nom} (${bestTeam.player9.Note})`}/>
      </div>
      <div className="gkLane4231">
      <Position playerName={players[10]} positionName="GK"onRoleChange={(role) => handleRoleChange(players[10], role)}selectedPlayer={bestTeam && `${bestTeam.player10.Nom} (${bestTeam.player10.Note})`}/>
      </div>
      <button onClick={handleGetBestTeam}>Get Best Team</button>
    </div>
  );
}

export default Formation4231;
